import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {
  return (
    <div className="col-md-3 mb-4">
      <div className="aqua-gradient color-block mb-3 mx-auto rounded-circle z-depth-1"></div>
      <h5 className="mb-0">aqua-gradient</h5>
    </div>
  );
}

export default App;
